function oncalc(){let e=$("#usage").val(),t=parseFloat(e),o=32;""==e||Number.isNaN(t)?Swal.fire({icon:"error",title:"오류!",text:"숫자를 입력해주세요",footer:""==e?"숫자 입력하는걸 까먹고 누르셨네요":"숫자만 입력가능하게 했는데 어케 입력하셨 ㄷㄷ"}):t<0?Swal.fire({icon:"error",title:"ㅓ라?",text:"0보다 작은데요?",footer:"0보다 적게 썼으면 뭘 한거죠 ㄷㄷ"}):0!=t?t>3348e3?Swal.fire({icon:"error",title:"네?",text:"너무 숫자가 큰데요?",footer:"10Gbps의 속도로 인터넷을 24시간 쉬지않고 쓰면 3348000GB가 최대네요."}):(o*=t,o=o.toFixed(1),o<=5e3?Swal.fire({icon:"success",title:"좋아요!",text:`평균 이하의 이산화탄소를 배출했어요!\n이번달에 ${o}g 의 이산화탄소를 배출했어요`,footer:"대한민국 평균 이산화탄소 배출량은 5497.6g입니다."}):o<=6e3?Swal.fire({icon:"warning",title:"조금만 더 노력해요!",text:`평균과 비슷한 이산화탄소를 배출했어요\n이번달에 ${o}g 의 이산화탄소를 배출했어요`,footer:"대한민국 평균 이산화탄소 배출량은 5497.6g입니다."}):Swal.fire({icon:"error",title:"인터넷 좀 그만 써요!",text:`평균보다 ${(o-5497.6).toFixed(1)}g 더 많은 이산화탄소를 배출했어요!\n이번달에 ${o}g 의 이산화탄소를 배출했어요.`,footer:"대한민국 평균 이산화탄소 배출량은 5497.6g입니다."})):Swal.fire({icon:"error",title:"음?",text:"계산을 해야해요?",footer:"인터넷을 안 썼으면 당연히 0g아닐까요?"})}$(document).ready(()=>{$("#calc").on("click",()=>(oncalc(),!1))});
